        </div>
        <div className="content">
            <h5>${title}</h5>
            <div className="innercontent">
            <div className="text">
              <p>${amount}</p> 
               <p>${date}</p>
            
               <p>
                ${note}
               </p>
            </div>
                <div className="del-btn">
                  {deleteItem}
                </div>
            </div>
        </div>
       
        </>
    )
}
